bench_function_base.Sort.time_sort_worst.code:
class SortWorst:
    def time_sort_worst(self):
        np.sort(self.worst)

    def setup(self):
        # quicksort median of 3 worst case
        self.worst = np.arange(1000000)
        x = self.worst
        while x.size > 3:
            mid = x.size // 2
            x[mid], x[-2] = x[-2], x[mid]
            x = x[:-2]

